import { Link, useNavigate } from 'react-router-dom'

const Home = () => {

  const navigate = useNavigate();

  function navigateHandler() {
    navigate('/products')
  }

  return (
    <>
      <h1>My Home Page</h1>
      <p>Go to the <Link to="/products">list of products</Link>.</p>
      <p>
        <button onClick={navigateHandler}>Navigate</button>
      </p>
    </>
  )
}

export default Home
